import React, { useState } from 'react';
import './header.css';
import logo from '../../imagenes/logo.png';

const Header = ({ handleFormVisibilityRegistro, handleFormVisibilityInicioSesion, handleDetailsVisibility }) => {
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearchInputChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleSearchSubmit = (event) => {
    event.preventDefault();
    handleDetailsVisibility(searchQuery);
  };

  return (
    <header>
      <div className="logoDiv">
        <img className="logoHeader" src={logo} alt="Logo" />
      </div>

      <div className="input-group">
        <form onSubmit={handleSearchSubmit}>
          <input
            type="text"
            className="form-control input-lg"
            aria-label="Recipient's username"
            aria-describedby="button-addon2"
            value={searchQuery}
            onChange={handleSearchInputChange}
          />
          <button className="btn btn-outline-secondary btn-lg" type="submit">
            Buscar
          </button>
        </form>
      </div>

      <div className="login">
        <a className="dropbtn">Iniciar sesi√≥n / Registrarse</a>
        <div className="login-content">
          <button onClick={handleFormVisibilityInicioSesion}>Inicio</button>
          <button onClick={handleFormVisibilityRegistro}>Registrarse</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
